INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(1, 597, 'RS werd verschillende keren gecontacteerd zonder resultaat; JS is dan alleen begonnen');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(2, 638, 'JVR is steeds onbereikbaar');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(3, 509, 'Frank moet echt alles uitleggen aan Stephen zodat het werk niet vooruit gaat');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(4, 639, 'Maar 10 minuten ondervragen, slechts 1 persoon. \\textbf{Code doorgestuurd via mail op 15 mei}');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(5, 642, 'Maar 10 minuten ondervragen, slechts 1 persoon');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(6, 514, 'Evelien heeft bijna alles gedaan, kreeg Stef pas te pakken in week 2 en hij kon weinig doen vanwege ziekenhuis opname. Stef is pas laatste avond voor deadline in gang geschoten');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(7, 618, 'Fons deed het meeste werk, bijdrage van Matthias is vrij beperkt');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(8, 637, 'Karen heeft bijna alles gedaan, Glenn was hele tijd onbereikbaar vanwege op reis(?)');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(9, 634, 'Y Meertens meldde dat Y Michielsen code van buitenaf gekregen heeft. Vraag welke code zelf geschreven is en stel enkel daarover vragen. \\textbf{Stuur hen na de ondervraging naar bureau vd monitor (200i, 3.10)}');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(10, 534, 'beiden student met functiebeperking, communicatie verliep stroef, Xander begreep de heel beknopte commentaar v Jorn nt, ongelukkige planning. \\textbf{Zeker vragen hoe ze ontbrekende stukken zouden toevoegen}');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(11, 625, 'Evert had zijn deel gedaan, doorgestuurd naar Vincent die zou afwerken. Originele code van Evert was vervangen door slechtere code. Nog even geprobeerd samen aan te passen. Evert heeft geen idee over de genomen programmeerbeslissingen. \\textbf{Ieder op eigen werk evalueren + vragen waarom Evert zo laat doorgestuurd heeft NA ondervraging}');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(12, 910, 'door tijdsgebrek eerder minimaal');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(13, 790, 'Veel problemen, daardoor niet fatsoenlijk');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(14, 796, 'Moeilijk leerstof in praktijk brengen');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(15, 774, 'Vooral Dries heeft het werk gedaan. Check eens uit.');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(16, 707, 'Melissa De Raedt liet tijdens het practicum weten dat ze met de richting gaat stoppen.');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(17, 685, 'Anneleen Smedts is gestopt tijdens het practicum');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(18, 712, 'Normaal gezien samen met Maxime Lambeets, maar die is met bedenkelijke mail naar prof veranderd van groepje.');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(19, 903, 'Maxime heeft op lompe wijze haar teamgenoot gedumpt om samen met Benjamin te werken');
INSERT INTO `prac_opmerking` (`id`, `groepid`, `opmerking`) VALUES(20, 777, 'De Vos Lisa is nooit komen opdagen, Engels Liene heeft alles alleen gedaan');
